import React ,{component} from 'react';
import data from './a.json';
var element=data;
class Post extends component{
    constructor(){
        super()

    }

    render()
    {
        return(

            element.map((e)=>
            {
                <ui>
                    <li>{e.id}</li>
                    <li>{e.userId}</li>
                    <li>{e.title}</li>
                    <li>{e.body}</li>

                </ui>
            }
            )
        )

    }
}
export default Post;
